import img1 from './carousel_img/chain.jpg';
import img2 from './carousel_img/753.jpg';
import img3 from './carousel_img/about.jpg';
import img4 from './carousel_img/two.jpg';

export const CarouselData=[
  {
    cName:"active",
    number:"0",
    image:img1,
    text:"<h1>Flash Box</h1>"+
         "<h6>We are the solution for your shipping problem</h6>"+
         "<span className='capspan'>Anytime, anywhere and on time.</span>"
  },
  {
    number:"1",
    image:img2,
    text:"<span className='capspan2'>Your package is in a flash!</span>"
  },
  {
    number:"2",
    image:img3,
    text:"<p className='mt-3'>"+
         "<span className='sp'>Faster</span>"+
         "<span className='sp'>Smarter</span>"+
         "<span className='sp2'>Reliable services.</span>"+
         "</p>"
  },
  {
    number:"3",
    image:img4,
    text:"<span class='cap4head'>Recycling carton</span>"+
          "<p className='mt-3'>"+
          "<span className='quote'>"+
          "The greatest threat to our planet is the belief"+
          "that somone else will save it."+"ROBERT SWAN</span>"+
          "</p>"
}
]
